import React from 'react'

const Wieso = () => {
  return (
    <div className={classes["wieso-container"]}>
        <h1>Wieso Lichtenberg</h1>
        <p>Es gibt viele Gründe, warum es toll ist, im Lichtenberg zu wohnen. Eine der Hauptattraktionen ist die landschaftliche Schönheit der Region. Lichtenberg liegt in einer malerischen Umgebung, umgeben von Hügeln, Wäldern und Seen. Diese Landschaft bietet eine Fülle von Freizeitmöglichkeiten wie Wandern, Radfahren, Schwimmen und Angeln.</p>
   <p>Eine weitere Stärke des Lichtenbergs ist seine Gemeinschaft. Die Einwohner des Lichtenbergs sind freundlich und einladend. Die Gemeinde ist eng verbunden und es gibt viele Aktivitäten und Veranstaltungen, bei denen man sich treffen und kennen lernen kann. Es gibt viele lokale Vereine und Organisationen, die sich für die Belange der Gemeinde engagieren und die Zusammenarbeit fördern.</p>
   <p>Schließlich ist Lichtenberg auch ein großartiger Ort zum Arbeiten und Gründen eines Unternehmens. Es gibt eine Vielzahl von Industrie- und Gewerbegebieten in der Nähe, sowie eine gute Anbindung an das Verkehrsnetz. Lichtenberg bietet somit gute Bedingungen für das Wachstum von Unternehmen und die Schaffung von Arbeitsplätzen.</p>
   <p>Zusammenfassend bietet Lichtenberg eine Kombination aus natürlicher Schönheit, starkem Gemeinschaftsgeist, guter Infrastruktur und wirtschaftlichem Potenzial. All diese Faktoren machen Lichtenberg zu einem großartigen Ort zum Leben und Arbeiten.</p>
    </div>
  )
}

export default Wieso
